import React from 'react'

const LeaderboardItem = ({goal, type, time}) => {
  let score = 0;
  if (type === 'pass/fail') {
    score = 1;
  }
  else if (type === 'total') {
    score = 2;
  }
  else {
    score = 3;
  }

  return (
    <div>
      <p>{goal._id}</p>
      <p>{score}</p>
    </div>
  )
}

export default LeaderboardItem;
